import Nav from "@/views/inc/Nav.vue";
export default {
    name: "personal_infor",
    components:{
        Nav
    },
    data(){
        return{
            ruleForm1:{
                newphonenumber:''
            },
            editRules1:({
                newphonenumber:[
                    {
                        required: true,
                        message: '请手机号码',
                        trigger: 'blur'
                    },
                    {pattern:'^1[0-9]{10}$',message:'请输入以1开头的11位数字',trigger:'blur',}
                ]

            }),
            dialogVisible1:false,
        }
    },
    methods:{
        submit_check1() {
            this.$refs.ruleForm1.validate((valid) => {
                if (valid) {
                    alert('修改成功!');
                }
                else {
                    return false;
                }
            })
        },
